import * as locales from './locales'
import {ReactComponent as Albania} from '../Assets/Svg/flags/Albania.svg'
import {ReactComponent as USA} from '../Assets/Svg/flags/USA.svg'
import {ReactComponent as France} from '../Assets/Svg/flags/France.svg'
import {ReactComponent as Germany} from '../Assets/Svg/flags/Germany.svg'


const languages = {
   [locales.sq]:{
       value:locales.sq,
       label:"Albanian",
       flag:Albania
   },
   [locales.fr]:{
       value:locales.fr,
       label:"French",
       flag:France
   },
   [locales.de]:{
       value:locales.de,
       label:"German",
       flag:Germany
   },
   [locales.en]:{
    value:locales.en,
    label:"English",
    flag:USA
   },
}

export default languages;
